class Simulation:
  delay: float = 0.3
  lyrics: list = []
  startTime: float = None
  midThread: threading.Thread = None
  
  def __init__(me):
    base64_str = s.replace(" ", "").replace("\n", "")
    parts = base64_str.split("#")
    
    mid_data = bz2.decompress(base64.b64decode(parts[0]))
    with open("world.execute(me).mid", "wb") as out_file:
      out_file.write(mid_data)

    lrc_data = bz2.decompress(base64.b64decode(parts[1])).decode()
    with open("world.execute(me).lrc", "w") as out_file:
      out_file.write(lrc_data)

    matches = re.findall(r"\[(\d+):(\d+)\.(\d+)\](.*)", lrc_data)
    Simulation.lyrics = [[int(match[0]) * 60 + int(match[1]) + int(match[2])/1000 + Simulation.delay, match[3].strip()] for match in matches]
    Simulation.midThread = threading.Thread(target = Simulation.playMid, daemon = True)


  def playMid():
    vfw32 = ctypes.CDLL("msvfw32.dll")
    user32 = ctypes.windll.user32
    kernel32 = ctypes.windll.kernel32

    hwnd = vfw32.MCIWndCreateA(user32.GetForegroundWindow(), kernel32.GetModuleHandleA(0), 0x40000000 | 8, "world.execute(me).mid\0".encode("ascii"))
    Simulation.startTime = time.time()
    user32.SendMessageW(hwnd, 0x0806, None, None)


  def playLrc():
    user32 = ctypes.windll.user32

    for i,lyric in enumerate(Simulation.lyrics):
      while Simulation.startTime is None or time.time() < lyric[0] + Simulation.startTime:
        time.sleep(0.1)

      if i >=86 and i <= 97:
        threading.Thread(target = user32.MessageBoxW, args = (None, "ILLEGAL EXECUTION", "Warning", 0x10 | 0x1000), daemon = True).start()
      elif i == 103:
        hwnd = user32.FindWindowW(None, "Warning")
        while hwnd:
          user32.PostMessageW(hwnd, 0x0010, 0, 0)
          hwnd = user32.FindWindowW(None, "Warning")
          
      print(lyric[1] + "\n")
  

  def execute(*args):
    os.system("chcp 65001")
    os.system("cls")
    Simulation.midThread.start()
    Simulation.playLrc()




world = Simulation()
me = "Nahida"

world.execute(me);

